import theme from "./UI/Theme";
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';


const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none"
})

const Banner = () => {
  return (
    <div class="hero-image">
      <div class="hero-text">
        <h1>Ad eos saepe lucilius, noster postulant.</h1>
        <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum. At nam minimum ponderum.</p>
        <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
      </div>
    </div>
  )
};

export default Banner;
